import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import BotCollection from './components/BotCollection';
import YourBotArmy from './components/YourBotArmy';
import BotSpecs from './components/BotSpecs'; // Import BotSpecs component
import SortBar from './components/SortBar';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Bot Army</h1>
        <Routes>
          <Route path="/" element={<SortBar />} />
          <Route path="/" element={<BotCollection />} />
          <Route path="/your-bot-army" element={<YourBotArmy />} />
          <Route path="/bots/:botId" element={<BotSpecs />} /> {/* Route for BotSpecs */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
